const contactText = candidateData.email + ' | ' + candidateData.mobile + '\n';
const locationText = candidateData.currentLocation + '\n\n';
const dividerText = '━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━━\n\n';

const headerLength = nameText.length + contactText.length + locationText.length + dividerText.length;

// Original CV
const cvText = candidateData.textCv || 'CV not available';

const requests = [
  // 1. Insert name
  {
    insertText: {
      location: { index: 1 },
      text: nameText
    }
  },

  // 2. Format name - centered, bold, 18pt
