      range: { startIndex: 1, endIndex: nameText.length + 1 },
      paragraphStyle: { alignment: 'CENTER' },
      fields: 'alignment'
    }
  },
  {
    updateTextStyle: {
      range: { startIndex: 1, endIndex: nameText.length },
      textStyle: { bold: true, fontSize: { magnitude: 18, unit: 'PT' } },
      fields: 'bold,fontSize'
    }
  },

  // 3. Insert contact
  {
    insertText: {
      location: { index: nameText.length + 1 },
      text: contactText
    }
  },

  // 4. Format contact - centered
  {
    updateParagraphStyle: {
      range: { startIndex: nameText.length + 1, endIndex: nameText.length + contactText.length + 1 },
      paragraphStyle: { alignment: 'CENTER' },
      fields: 'alignment'
    }
  },

  // 5. Insert location
  {
