      location: { index: headerLength + 1 },
      text: cvText
    }
  }
];

return {
  json: {
    documentId: documentId,
    requests: requests
  }
};

const formattedResume = $json.output[0].content[0].text;
const documentId = $('Format and Insert CV').item.json.documentId;
const candidateName = $('Format and Insert CV').item.json.candidateName;

// Split into lines to find what to format
const lines = formattedResume.split('\n');
let currentIndex = 1; // Google Docs starts at index 1
const requests = [];

// First, insert all the text
requests.push({
  insertText: {
    location: { index: 1 },
    text: formattedResume
  }
});

// Now find and format headers (ALL CAPS lines)
for (let i = 0; i < lines.length; i++) {
  const line = lines[i];
  const lineLength = line.length;

  // Check if line is ALL CAPS (likely a header)
  if (line.length > 0 && line === line.toUpperCase() && line.trim().length > 3) {
    // Bold this line
    requests.push({
      updateTextStyle: {
        range: {
          startIndex: currentIndex,
          endIndex: currentIndex + lineLength
        },
        textStyle: {
          bold: true,
          fontSize: { magnitude: 12, unit: 'PT' }
        },
        fields: 'bold,fontSize'
      }
    });
  }

  // Check if this is the first line (name) - center it
  if (i === 0) {
    requests.push({
      updateParagraphStyle: {
        range: {
          startIndex: currentIndex,
          endIndex: currentIndex + lineLength + 1
        },
        paragraphStyle: {
          alignment: 'CENTER'
        },
        fields: 'alignment'
      }
    });
  }

  currentIndex += lineLength + 1; // +1 for newline character
}

return {
  json: {
    documentId: documentId,
    requests: requests,
    candidateName: candidateName
  }
};

// Get the cURL command from Apify
const curlCommand = $input.item.json.body.curlCommand;
const maxResults = $input.item.json.body.maxResults || 10;

// Extract URL from cURL (first quoted string after 'curl')
const urlMatch = curlCommand.match(/curl\s+['"]([^'"]+)['"]/i);
const url = urlMatch ? urlMatch[1] : null;

if (!url) {
  throw new Error('Failed to extract URL from cURL command');
}

// Parse ALL headers from cURL
const headers = {};
const headerParts = curlCommand.split(/-H\s+['"]/);

headerParts.forEach(part => {
  const closeQuoteIndex = part.indexOf("'");
  if (closeQuoteIndex === -1) return;

  const headerContent = part.substring(0, closeQuoteIndex);
  const colonIndex = headerContent.indexOf(':');

  if (colonIndex > 0) {
    const headerName = headerContent.substring(0, colonIndex).trim().toLowerCase();
    const headerValue = headerContent.substring(colonIndex + 1).trim();
    headers[headerName] = headerValue;
  }
});

// IMPORTANT: Parse cookies from -b flag (handles escaped quotes and JSON)
let cookies = headers.cookie || null;

if (!cookies) {
  // Match -b flag with proper quote handling
  // Use a more robust regex that captures everything between matching quotes
  let cookieMatch = curlCommand.match(/-b\s+'([^']+)'/i);

  if (!cookieMatch) {
    // Try double quotes
    cookieMatch = curlCommand.match(/-b\s+"([^"]+)"/i);
  }

  if (!cookieMatch) {
    // Try --cookie flag
    cookieMatch = curlCommand.match(/--cookie\s+'([^']+)'/i) || 
                  curlCommand.match(/--cookie\s+"([^"]+)"/i);
  }

  if (cookieMatch) {
    // Remove any escaped quotes from the cookie string
    cookies = cookieMatch[1].replace(/\\"/g, '"');
    headers.cookie = cookies;
  }
}

// ALWAYS generate fresh transaction ID
const transactionId = `rlsrp${Date.now()}~~${Math.random().toString(36).substr(2, 6)}`;
headers['x-transaction-id'] = transactionId;

// Parse JSON body
const bodyMatch = curlCommand.match(/--data-raw ['"]({.+?})['"]/s);
let parsedBody = {};

if (bodyMatch) {
  try {
    parsedBody = JSON.parse(bodyMatch[1]);
  } catch (e) {
    const unescaped = bodyMatch[1].replace(/\\"/g, '"');
    parsedBody = JSON.parse(unescaped);
  }
}

// Extract required fields from body
const requirementId = parsedBody.requirementId;
const companyId = parsedBody.miscellaneousInfo?.companyId;
const rdxUserId = parsedBody.miscellaneousInfo?.rdxUserId;
const rdxUserName = parsedBody.miscellaneousInfo?.rdxUserName;

// Validate
if (!cookies || !requirementId || !companyId || !rdxUserId || !rdxUserName) {
  throw new Error('Failed to parse cURL command. Missing required fields: ' + 
    JSON.stringify({ 
      hasCookies: !!cookies,
      cookieLength: cookies ? cookies.length : 0,
      requirementId, 
      companyId, 
      rdxUserId, 
      rdxUserName 
    }));
}

// Return ALL parsed data
return {
  // URL
  url: url,

  // All headers as object
  headers: headers,

  // Body data
  requirementId,
  companyId,
  rdxUserId,
  rdxUserName,
  maxResults,

  // Easy access to common headers
  cookies: cookies,
  transactionId: transactionId
};

